function Nav() {
  return (
    <nav id="TopBar">
      <a className="logo" alt="Home"></a>
      <ul class="SubNav">
        <li><a href="http://photo.errric.me" className="nav-btn nav-btn-1" target="blank">Photos</a></li>
        <li><a className="nav-btn nav-btn-2" >About me</a></li>
      </ul>
    </nav>
  );
}

export default Nav;
